import { BrowserRouter, Routes, Route, Link } from 'react-router-dom'
function App() {
  return (
    <BrowserRouter>
      <Link to='/'>Home2</Link>
      <Link to='/about'>About</Link>
      <Routes>
        <Route path="/" render={() => <h1>Welcome!</h1>} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
